import React from "react";
import '../App.css'
import { HomeNavBar } from "../Layouts/HomeNavBar";
import CardComponent from "../Layouts/CardComponent";

export function Rotines() {
    return (
        <div className="store">
            <div className='home_header'>
                <div><HomeNavBar/></div>
            </div>
            <CardComponent/>
        </div>
    )
}
